import React, { useState } from 'react';
import AddIcon from '@material-ui/icons/Add';
import { Button , Form , Row , Col} from 'react-bootstrap';



const NoteTitle = () => {
    const [currdata , getdata] = useState({
        title : '',
        content :  ''}
    )
    
    const eventInput =(e) => {
      
        const {value , name } = e.target
        console.log(name)
      getdata((preval) => {
          return{
              ...preval, 
              [name] : value
          }
      })
    }
  return (
   <>
  
       <Row className="justify-content-center">
           <Col xs="4">
           <div className="note-title text-center shadow  p-5">
           <Form className="form-group">
        <div class="form-group">
            <input 
              type="text" 
              class="form-control" 
              id="exampleFormControlInput1"
              onChange={eventInput} 
              name = "title"
             // value = {currdata.title}
              placeholder="Title" />
       </div>
            <textarea  
             class="form-control m-auto" 
             id="exampleFormControlTextarea1" 
             rows="3" placeholder="write a note..."
             name = "content"
             value = {currdata.content}

             onChange={eventInput} 
             ></textarea>
            <Button className="btn btn-dark float-right"> <AddIcon/> </Button>
        </Form>
        </div>
      </Col>
       </Row>
      
      
   </>
  )
 
}
export default NoteTitle;
